import styled from 'styled-components';

export const Div = styled.div`
margin-bottom: 15px;
`;

export const Input = styled.input`
width: 300px;
padding: 10px;
margin: 0 auto;
border-radius: 4px;
border: 1px solid #82d47b;
font-size: 20px;
`;
